import React from 'react';
import { Box, Button } from '@material-ui/core'

export default function HomeButtonGroup() {  
    return (
      <Box display="flex">
          <Box mr={2}>
          <Button variant="contained" >
              Enter
          </Button>
          </Box>
          <Box>
          <Button variant="contained">
              Leave
          </Button>
          </Box>
      </Box>
    );
  }
